--

CREATE FUNCTION ins_account_payment() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE
	rec					RECORD;
BEGIN
	
	IF(NEW.account_payment_id is not null)THEN
		SELECT sum(account_credit - account_debit) INTO NEW.balance
		FROM account_payment
		WHERE (account_payment_id < NEW.account_payment_id) AND (rental_id = NEW.rental_id);
	END IF;
	IF(NEW.balance is null)THEN
		NEW.balance := 0;
	END IF;
	NEW.balance := NEW.balance + (NEW.account_credit - NEW.account_debit);
	
	RETURN NEW;
END;
$$;


