    LANGUAGE plpgsql
    AS $_$
	DECLARE
		msg				varchar(120);
	BEGIN
		IF($3::integer = 1)THEN
			UPDATE entitys SET is_active = true WHERE entity_id = $1::int;
		msg := 'Activated';
		END IF;

